import React from 'react';
import Header from '../components/Header';
import Card from '../components/Card';
import Button from '../components/Button';

const Home: React.FC = () => (
  <>
    <Header />
    <main className="main-content">
      <h2>Welcome to UI Challenge 10</h2>
      <div className="card-grid">
        <Card title="Item 1" description="This is item one." />
        <Card title="Item 2" description="This is item two." />
      </div>
      <Button label="Learn More" variant="primary" onClick={() => alert('Clicked')} />
    </main>
  </>
);

export default Home;
